import {
  Box,
  Button,
  CardContent,
  CircularProgress,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TablePagination
} from "@material-ui/core";
import React, { useEffect, useState } from "react";
import { listUsers } from "../service/UserService";

export const AppList = () => {
  const [users, setUsers] = useState([]);
  const [err, setErr] = useState("");

  useEffect(() => {
    listUsers("/users")
      .then(({ data }) => {
        setUsers(data);
      })
      .catch(e => {
        setErr(e.message);
      });
  }, []);

  return (
    <div>
      {err}
      <table>
        <tr>
          <th>UserName</th>
          <p>{user.username}</p>
          <th>Savings</th>
        </tr>
        <tr>
          <td>January</td>
          <td>$100</td>
        </tr>
      </table>
      {users.map(user => (
        <div>

          <p>Email: {user.email}</p>
        </div>
      ))}
    </div>
  );
};
